import { useTooltip } from '../context/TooltipContext';

const Tooltip = ({ id, children, content }) => {
  const { openTooltipId, openTooltip, closeTooltip } = useTooltip();

  useEffect(() => {
    if (openTooltipId === id) {
      // Tooltip is open
    } else {
      // Tooltip is closed
    }
  }, [openTooltipId, id]);

  const handleMouseEnter = () => {
    openTooltip(id);
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
      style={{ position: 'relative', display: 'inline-block' }}
    >
      {children}
      {openTooltipId === id && (
        <div style={{ position: 'absolute', top: '100%', left: '50%', transform: 'translateX(-50%)', background: 'black', color: 'white', padding: '5px', borderRadius: '3px' }}>
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

